package leetcode;

import org.junit.jupiter.api.Assertions;
import org.junit.jupiter.api.Test;

public class Code392 {

    @Test
    public void test() {
        Assertions.assertTrue(isSubsequence("abc", "ahbgdc"));
    }


    @Test
    public void test1() {
        Assertions.assertFalse(isSubsequence("axc", "ahbgdc"));
    }

    @Test
    public void test2() {
        Assertions.assertTrue(isSubsequence("leeeeetcode", ""));
    }

    public boolean isSubsequence(String s, String t) {
        if (s == null || t == null) {
            return false;
        }
        if (s.length() == 0) {
            return true;
        }
        int[] arr = new int[s.length()];
        int x = -1;
        for (int i = 0; i < s.length(); i++) {
            int v = t.indexOf(s.charAt(i) + "", x + 1);
            if (v == -1) {
                return false;
            }
            arr[i] = v;
            x = v;
        }
        int k = arr[0];
        for (int i = 1; i < arr.length; i++) {
            if (arr[i] <= k) {
                return false;
            }
            k = arr[i];
        }
        return true;
    }
}
